import React, { useEffect, useState } from 'react';

function AIVisual() {
  const [activeLayer, setActiveLayer] = useState(0);
  const [hoveredElement, setHoveredElement] = useState(null);

  useEffect(() => {
    const timer = setInterval(() => {
      setActiveLayer(prev => (prev + 1) % 4);
    }, 2000);
    return () => clearInterval(timer);
  }, []);

  return (
    <div className="visual-container" style={{
      position: 'relative',
      width: '600px',
      height: '600px',
      background: 'linear-gradient(180deg, #000510 0%, #001030 100%)',
      borderRadius: '20px',
      overflow: 'hidden',
    }}>
      {/* Holographic Circle */}
      <div style={{
        position: 'absolute',
        top: '50%',
        left: '50%',
        transform: 'translate(-50%, -50%)',
        width: '400px',
        height: '400px',
        borderRadius: '50%',
        border: '2px solid rgba(0, 255, 255, 0.2)',
        boxShadow: '0 0 50px rgba(0, 255, 255, 0.1)',
        animation: 'rotate 20s linear infinite',
      }}>
        {/* Scanning Line */}
        <div style={{
          position: 'absolute',
          top: '50%',
          left: 0,
          right: 0,
          height: '2px',
          background: 'linear-gradient(90deg, transparent, #0FF, transparent)',
          animation: 'scan 4s ease-in-out infinite',
          opacity: 0.5,
        }} />
      </div>

      {/* Floating Data Layers */}
      {[0, 1, 2, 3].map((layer) => (
        <div
          key={layer}
          style={{
            position: 'absolute',
            top: '50%',
            left: '50%',
            transform: `
              translate(-50%, -50%)
              translateY(${(layer - activeLayer) * 40}px)
              scale(${1 - Math.abs(layer - activeLayer) * 0.1})
            `,
            width: '300px',
            padding: '15px',
            background: 'rgba(0, 255, 255, 0.05)',
            borderRadius: '10px',
            backdropFilter: 'blur(10px)',
            border: '1px solid rgba(0, 255, 255, 0.2)',
            opacity: 1 - Math.abs(layer - activeLayer) * 0.3,
            transition: 'all 0.5s ease',
          }}
        >
          <div style={{
            color: '#0FF',
            fontSize: '14px',
            fontFamily: 'monospace',
          }}>
            {getLayerContent(layer)}
          </div>
        </div>
      ))}

      {/* Floating Elements */}
      {[...Array(12)].map((_, i) => {
        const angle = (i * 30) * (Math.PI / 180);
        const radius = 160;
        const x = Math.cos(angle) * radius;
        const y = Math.sin(angle) * radius;

        return (
          <div
            key={i}
            style={{
              position: 'absolute',
              top: '50%',
              left: '50%',
              transform: `translate(${x}px, ${y}px)`,
              width: '40px',
              height: '40px',
              background: 'rgba(0, 255, 255, 0.1)',
              borderRadius: '50%',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              animation: `pulse 2s infinite ${i * 0.2}s`,
            }}
          >
            <div style={{
              width: '20px',
              height: '20px',
              background: '#0FF',
              borderRadius: '50%',
              opacity: 0.5,
            }} />
          </div>
        );
      })}

      {/* Holographic Stats */}
      <div style={{
        position: 'absolute',
        bottom: '30px',
        left: '50%',
        transform: 'translateX(-50%)',
        display: 'flex',
        gap: '20px',
      }}>
        {[
          { label: 'TOKENS', value: '2048' },
          { label: 'MEMORY', value: '96GB' },
          { label: 'CORES', value: '64' },
        ].map((stat, index) => (
          <div
            key={index}
            style={{
              background: 'rgba(0, 255, 255, 0.1)',
              padding: '10px 20px',
              borderRadius: '5px',
              border: '1px solid rgba(0, 255, 255, 0.2)',
              textAlign: 'center',
            }}
          >
            <div style={{ color: '#0FF', fontSize: '12px', opacity: 0.8 }}>
              {stat.label}
            </div>
            <div style={{ color: '#FFF', fontSize: '16px', marginTop: '5px' }}>
              {stat.value}
            </div>
          </div>
        ))}
      </div>

      {/* Particle Effects */}
      {[...Array(30)].map((_, i) => (
        <div
          key={`particle-${i}`}
          style={{
            position: 'absolute',
            width: '2px',
            height: '2px',
            background: '#0FF',
            borderRadius: '50%',
            left: `${Math.random() * 100}%`,
            top: `${Math.random() * 100}%`,
            opacity: Math.random() * 0.5,
            animation: `
              float ${3 + Math.random() * 4}s infinite linear ${Math.random() * 2}s,
              glow 2s infinite ease-in-out ${Math.random()}s
            `,
          }}
        />
      ))}
    </div>
  );
}

function getLayerContent(layer) {
  const content = [
    "INITIALIZING NEURAL NETWORK...",
    "PROCESSING LANGUAGE PATTERNS...",
    "ANALYZING SEMANTIC CONTEXT...",
    "GENERATING RESPONSE...",
  ];
  return content[layer];
}

export default AIVisual;
